import React from "react";
import { Link } from "react-router-dom";

import styles from "./Navbar.module.css";

const Navbar = (props) => {
    return (
        <nav>
            <ul>
                <Link className={styles.active} to="/">
                    Shop
                </Link>

                <Link className={styles.deactive} to="/Cart">
                    Cart
                </Link>
            </ul>
        </nav>
    );
};

export default Navbar;
